function Calculator(){
      const styl={
            backgroundColor:'Grey',
            fontSize:'500',
            border:'10px solid black',
            boxSizing:'border-box'
      }


      return(
        <h1 style={styl}>We are making calculator</h1>
      );
}
export default Calculator;
